    "fairfax-county-contours",nt"isopen": false,nt"url": null,nt"notes":
    "This layer contains contours that were derived from the digital terrain model
    made up of irregularly spaced mass points and breaklines. The contours are 5 foot
    intervals and are broken down into 9 different types. These include index, intermediate,
    index depression, intermediate depression, indefinite area index, indefinite area
    intermediate, indefinite area depression index, and indefinite area depression intermediate
    and hidden. The indefinite area contours are contours that cross into an area where
    the ground was difficult to see in the model due to dense trees or construction.
    The hidden portion of contours are under buildings and where the contour annotation
    is placed or where contours become very close due to very steep slope. For the 5ft.
    and 2ft. contours contained in this folder, each line represents only the elevation
    value. Please note that the 2ft. contours were derived from the 5ft. contours and
    do not represent a new data source.",nt"license_title": null,nt"extras":
